import React, {useState,useEffect, Component } from 'react'

function ApiCall(){
    useEffect(
        ()=> {
            fetchItems();
        },[]
    );


    const fetchItems = async() => {
        const data = await fetch ('https://fortnite-api.theapinetwork.com/upcoming/get');
        const items = await data.json();
        console.log(items);
    }


}

export default ApiCall
